import{_ as i,a as e}from"./chunks/Optical.BkFnt69g.js";import{_ as r,c as a,a2 as o,o as s}from"./chunks/framework.8rFHF1Cf.js";const n="/drone-in-a-box/assets/SwiftPro/swiftProProduct.jpg",l="/drone-in-a-box/assets/SwiftPro/rpi_cam.png",d="/drone-in-a-box/assets/SwiftPro/rpi.png",p="/drone-in-a-box/assets/SwiftPro/Lidar.png",c="/drone-in-a-box/assets/SwiftPro/moters.png",g="/drone-in-a-box/assets/SwiftPro/SwiftProFrontSide.png",h="/drone-in-a-box/assets/SwiftPro/SwiftProBackSide.png",P=JSON.parse('{"title":"Swift Pro Drone","description":"","frontmatter":{},"headers":[],"relativePath":"docs/swiftPro/description.md","filePath":"docs/swiftPro/description.md"}'),m={name:"docs/swiftPro/description.md"};function f(u,t,b,y,w,S){return s(),a("div",null,t[0]||(t[0]=[o('<h1 id="swift-pro-drone" tabindex="-1">Swift Pro Drone <a class="header-anchor" href="#swift-pro-drone" aria-label="Permalink to &quot;Swift Pro Drone&quot;">​</a></h1><h2 id="description" tabindex="-1">Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;Description&quot;">​</a></h2><div><p> The Swift Pro Drone is a lightweight, 190-gram drone optimized for educational purposes, offering strong performance and flexibility for various applications. Powered by an STM32F4 Arm Cortex M4 flight controller and a Raspberry Pi Zero 2 W as the onboard computer, it provides robust computational power with its quad-core processor and 512MB of RAM. </p><p> Key sensors include a 5 MP camera for imaging, an optical flow sensor paired with a Lidar range finder for accurate altitude and position control, and a GPS with a compass for location tracking. This sensor suite enhances the drone&#39;s ability to perform precise indoor navigation, making it ideal for environments where GPS signals may be limited. </p><p> The Swift Pro Drone supports multiple firmware options, including Ardupilot, Betaflight, and INAV, allowing customization for different flight styles and tasks. It can be controlled via ExpressLRS, ROS1, or ROS2, making it a versatile tool for autonomous operation and mission planning. </p><p> With a flight time of 11 minutes and brushless motors for efficient thrust, it is well-suited for tasks like path planning, image processing, and mission execution in indoor settings. Its primary applications involve indoor research, educational purposes, and practical experimentation with autonomous systems </p></div><h2 id="payload-capacity" tabindex="-1">Payload Capacity <a class="header-anchor" href="#payload-capacity" aria-label="Permalink to &quot;Payload Capacity&quot;">​</a></h2><ul><li><strong>Maximum Payload</strong>: 0 KGs.</li></ul><h2 id="images" tabindex="-1">Images <a class="header-anchor" href="#images" aria-label="Permalink to &quot;Images&quot;">​</a></h2><p><img src="'+n+'" alt="Swift Pro"></p><h2 id="flight-time" tabindex="-1">Flight Time <a class="header-anchor" href="#flight-time" aria-label="Permalink to &quot;Flight Time&quot;">​</a></h2><ul><li><strong>Maximum Flight Time</strong>: 11 Minutes.</li></ul><h2 id="application" tabindex="-1">Application <a class="header-anchor" href="#application" aria-label="Permalink to &quot;Application&quot;">​</a></h2><p>Object identification, Tracking.</p><h2 id="components-used" tabindex="-1">Components Used <a class="header-anchor" href="#components-used" aria-label="Permalink to &quot;Components Used&quot;">​</a></h2><ul><li><p><strong>Flight Controller</strong>: <a href="https://flywoo.net/products/goku-gn745-45a-aio-bl_32-mpu6000-v3?srsltid=AfmBOorbbwncbJfNjdSvtDfeR1pO7N6U7WJpLcxdW_EToCIce4uHlw5y" target="_blank">FIYWOO GOKU GN7 45 AIO V3</a></p><div style="display:flex;align-items:center;"><div style="flex:1;"><p> The FIYWOO GOKU GN7 45 AIO V3 is a highly integrated flight controller designed for advanced drone applications. It features a 4-in-1 design, combining a flight controller, ESC (Electronic Speed Controller), and other essential components into a single compact unit. This integration simplifies the build process, reduces wiring complexity, and minimizes weight, making it ideal for high-performance and racing drones. </p></div><div style="flex:1;text-align:right;"><img src="'+i+'" alt="FIYWOO GOKU GN7 45 AIO V3" width="400" style="margin-left:20px;"></div></div><p><strong>Key Features:</strong></p><ul><li><strong>Processor:</strong> Equipped with a high-performance flight controller processor for smooth and reliable operation.</li><li><strong>ESC Integration:</strong> Includes a 45A ESC, providing efficient power management and support for high-current motors.</li><li><strong>Compatibility:</strong> Supports various flight stacks and is compatible with popular drone flight software like Betaflight, iNav, and others.</li><li><strong>Sensors:</strong> Integrates essential sensors for accurate flight control and stabilization.</li><li><strong>Build Quality:</strong> Designed with durability and reliability in mind, suitable for both professional and hobbyist applications.</li></ul></li><li><p><strong>Camera</strong>: <a href="https://www.raspberrypi.com/products/camera-module-v2/" target="_blank">Raspberry Pi Camera Module 2</a></p><div style="display:flex;align-items:center;"><div style="flex:1;"><p> The Raspberry Pi Camera Module 2, introduced in April 2016, upgrades from the original Camera Module with an 8-megapixel Sony IMX219 sensor, enhancing image quality, color fidelity, and low-light performance. It supports high-definition video recording (1080p30, 720p60, VGA90) and still photography. Compatible with all Raspberry Pi models (1, 2, 3, and 4) and accessible via the MMAL and V4L APIs, it is also supported by third-party libraries like Picamera for advanced projects. For Raspberry Pi Zero users, a specific camera cable is required. This module is widely used in applications such as home security and wildlife monitoring. </p></div><div style="flex:1;text-align:right;"><img src="'+l+'" alt="Raspberry Pi Camera Module 2" width="800" style="margin-left:20px;"></div></div></li><li><p><strong>Microprocessor</strong>: <a href="https://www.raspberrypi.com/products/raspberry-pi-zero-2-w/" target="_blank">Raspberry Pi Zero 2W</a></p><div style="display:flex;align-items:center;"><div style="flex:1;"><p> The Raspberry Pi Zero 2W features a 1GHz quad-core Arm Cortex-A53 CPU, 512MB SDRAM, and built-in 2.4GHz wireless LAN and Bluetooth 4.2 with BLE. It includes a mini HDMI port, micro USB OTG port, microSD card slot, CSI-2 camera connector, and a HAT-compatible 40-pin header. It supports 1080p30 video decoding and encoding, OpenGL ES 1.1 and 2.0 graphics, and is powered via micro USB. Measuring 65mm x 30mm, it is compact and versatile for various projects. </p></div><div style="flex:1;text-align:right;"><img src="'+d+'" alt="Raspberry Pi Zero 2W" width="1500" style="margin-left:20px;"></div></div></li><li><p><strong>Lidar</strong>: <a href="https://holybro.com/products/st-vl53l1x-lidar/" target="_blank">VL53L1X</a></p><p>The VL53L1X is a high-speed Time-of-Flight laser-ranging sensor from the ST FlightSense™ series.</p></li></ul><div style="display:flex;align-items:flex-start;"><div style="flex:1;margin-right:20px;"><table><thead><tr><th>Feature</th><th>Specification</th></tr></thead><tbody><tr><td><strong>Operating Voltage</strong></td><td>&gt;2.8 V</td></tr><tr><td><strong>Communication Type</strong></td><td>I²C</td></tr><tr><td><strong>Max Range</strong></td><td>120 CM</td></tr><tr><td><strong>Min Range</strong></td><td>5 CM</td></tr></tbody></table></div><div style="flex:1;text-align:right;"><img src="'+p+'" alt="Lidar Sensor" width="200"></div></div><br><ul><li><p><strong>Optical Flow Sensor</strong>: <a href="https://holybro.com/products/pmw3901-optical-flow-sensor" target="_blank">Holybro PMW3901 Optical Flow Sensor</a></p><div style="display:flex;align-items:center;"><div style="flex:1;"><p> The Holybro PMW3901 Optical Flow Sensor is a compact, UART-based sensor with a built-in BEC and pre-soldered 6-pin JST GH connector. It&#39;s compatible with PX4 and Ardupilot flight controllers and uses the same data format as the discontinued CX-OF model. Specs: 14 x 11 x 5 mm, 0.6 g, 19200 baud rate, 95 Hz frame rate, 2.0-3.6V power, 10 mA current. Data Format: Includes X/Y motion bytes, checksum, and surface quality. Package: Sensor, 170mm GH6P cable, TPU case. </p></div><div style="flex:1;text-align:right;"><img src="'+e+'" alt="Raspberry Pi Zero 2W" width="200" style="margin-left:20px;"></div></div></li><li><p><strong>Motors</strong>: <a href=" https://geprc.com/product/geprc-speedx2-1303-5-3800kv-5500kv-motor/" target="_blank">GEPRC SPEEDX2 1303.5 3800KV Motor</a></p><div style="display:flex;align-items:center;"><div style="flex:1;"><p> The SPEEDX2 1303.5 is a lightweight brushless motor (6.5g) designed for 2-inch cinewhoop FPV and 2.5-inch freestyle drones. Its unique outer rotor blade design enhances compatibility with inverted-mounted propellers, preventing unbalance. Constructed from durable 7075-T aircraft aluminum, it features excellent heat dissipation and stability due to its hollow structure and high-quality N52H magnets. With a maximum power output of 139.9W, it provides a smooth flying experience. Compatible with 2S and 4S LiPo batteries, it includes mounting screws for easy installatio </p></div><div style="flex:1;text-align:right;"><img src="'+c+'" alt="Raspberry Pi Zero 2W" width="400" style="margin-left:20px;"></div></div></li><li><p><strong>Batteries: Tattu 850mah 75c</strong></p><div><p style="text-align:justify;"> The Tattu 850mAh 3S 75C LiPo battery is engineered for UAV and UAS applications, offering high quality and reliability. Packaged in vibration-proof and fire-proof materials, it ensures safe storage. With advanced stacking technology, it delivers an 850mAh capacity, high discharge performance, and energy density, using premium lithium polymer materials. </p></div></li><li><p><strong>Specifications:</strong></p></li></ul><table tabindex="0"><thead><tr><th>Feature</th><th>Specification</th></tr></thead><tbody><tr><td><strong>Capacity</strong></td><td>850mAh</td></tr><tr><td><strong>Voltage</strong></td><td>11.1V (3S)</td></tr><tr><td><strong>Discharge Rate</strong></td><td>75C (Max Burst: 150C)</td></tr><tr><td><strong>Weight</strong></td><td>74g</td></tr><tr><td><strong>Dimensions</strong></td><td>60mm x 30mm x 23mm</td></tr></tbody></table><div><p style="text-align:justify;"> Tattu&#39;s <strong>less is more</strong> philosophy means lighter weight and longer flight times, ideal for multirotor FPV 150-size drones. </p></div><h2 id="schematic" tabindex="-1">Schematic <a class="header-anchor" href="#schematic" aria-label="Permalink to &quot;Schematic&quot;">​</a></h2><ul><li>Download the <a href="/drone-in-a-box/assets/files/SwiftProFrontSide.png" download="SwiftProFrontSide.png">Download the Swift Pro Drone Schematic-Front Side </a>file.</li></ul><br><p><img src="'+g+'" alt="Swift Pro Drone Schematic"></p><br><ul><li>Download the <a href="/drone-in-a-box/assets/files/SwiftProBackSide.png" download="SwiftProBackSide.png">Swift Pro Drone Schematic-Back Side</a> file.</li></ul><br><p><img src="'+h+'" alt="Swift Pro Drone Schematic"></p>',26)]))}const k=r(m,[["render",f]]);export{P as __pageData,k as default};
